header {
    display: flex;
    justify-content: space-between;
    background: $midnight-green;
    width: 100%;
    padding: 4em 2em 0 2em;
    position: relative;
    box-sizing: border-box;

    .logo {
        width: 128px;
        height: 32px;
    }

    .mobile-menu {
        display: block;
        width: 20px;
        height: 17px;
        z-index: 2;
    }

    .mobile-nav-blur {
        display: none;
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        height: 100vh;
        width: 100vw;
        background: $mobile-wrapper;
        z-index: 2;

        &.show {
            display: block;
        }
    }

    .navbar {
        display: none;
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        width: 260px;
        height: 100vh;
        background: $police-blue;
        flex-direction: column;
        padding: 5em 2em 0 4em;
        z-index: 3;

        .close-menu {
            align-self: flex-end;
        }

        ul {
            align-self: flex-start;
            display: flex;
            flex-direction: column;

            li {

                &:first-child {
                    margin: 4em 0 0 0;
                }

                &:not(:first-child) {
                    margin: 3em 0 0 0;
                }

                &:last-child {
                    a {
                        &:hover, &:focus {
                            color: $police-blue;
                        }
                    }
                }
                a {
                    font-size: 1.5rem;
                    color: $white;
                    font-weight: 500;
                }
            }
        }

        &:after {
            content: '';
            position: absolute;
            background-image: url("../images/bg-pattern-about-1-mobile-nav-1.svg");
            background-repeat: no-repeat;
            background-position: bottom 0 right -100px;
            bottom: 0;
            right: 0;
            width: 200px;
            height: 200px;
            display: block;
        }

        &.show {
            display: flex;
        }
    }
}

