        display: flex;
        flex-direction: column;
        align-items: center;
        padding: 4em 0 0 0;

        figure {
            padding: 4em 0; 
            position: relative;
            z-index: 1;

            &:last-child {
                padding: 4em 0 0 0;
            }

            blockquote {
                font-size: 1.2em;
                font-weight: 600;
                color: $white;
                line-height: 2em;
                text-align: center;
                letter-spacing: .025em;
            }

            figcaption {
                display: flex;
                flex-direction: column;
                align-items: center;
                padding: 2em 0 0 0;

                cite {
                    &:first-child {
                        color: $rapture-blue;
                        font-size: 1.5em;
                        font-weight: 700;
                        font-style: normal;
                        letter-spacing: .02em;
                    }

                    &:nth-child(2) {
                        color: $white;
                        font-size: 1.1em;
                        font-weight: 500;
                        letter-spacing: .02em;
                        padding: .5em 0 1.2em 0;
                    }
                }

                img {
                    width: 62px;
                    height: 62px;
                    border-radius: 50%;  
                    border: 2px solid $white; 
                }
            }

            &:before {
                content: '';
                position: absolute;
                width: 67px;
                height: 56px;
                top: 1.1em;
                left: calc(50% - 33.5px);
                background-image: url("../images/icon-quotes.svg");
                background-repeat: no-repeat;
                z-index: -1;
            }
        }
    }

    &:before, &:after {
        content: '';
        position: absolute;
        display: block;
        background-repeat: no-repeat;
    }

    &:before {
        background-image: url("../images/bg-pattern-home-4-about-3.svg");
        top: 0;
        left: 0;
        width: 147px;
        height: 100px;
    }

    &:after {
        background-image: url("../images/bg-pattern-home-5.svg");
        bottom: 0;
        right: 0;
        width: 200px;
        height: 100px;
    }
}

